import React, { PureComponent } from 'react';
import { register, unregister } from 'next-offline/runtime'

class NextOffline extends PureComponent {
    componentDidMount() {
        register().then((res) => {
            console.log(res);
        });
    }
    componentWillUnmount() {
        unregister();
    }

    render() {
        return null;
    }
}

export default NextOffline;
